import search from './search.css'

const Search = () => {
    return (
        <div>
            <input type="text" 
            placeholder="Search"
            className="mr-sm-2 form-control form-inline"/>
            <button className="btn-outline-success btn" type='search'>search</button> 
        </div>
    )
}
export default Search;
